import React,{ useState } from 'react';
import Filter from './Components/Filter';
import MovieList from './Components/MovieList';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  const [search,setSearch]= useState("");
  const [rate,setRate]= useState(1);
  const [input, setInput] = useState("");
  const [inputSrc, setInputSrc] = useState("");
  const [inputRate, setInputRate] = useState("");
  const [inputDescription, setInputDescription] = useState("");
  const [movieList, setMovieList] = useState([{titre:"Bad Boys",img:"data:image/jpeg;base64,",rate:5,description:"Action"},
  
  {titre:"The dark knight",img:"data:image/jpeg;base64," ,rate:3,description:"Best One"},{titre:"Titanic",img:"https://images-na.ssl-images-amazon.com/images/I/71e5a3+CStL._RI_.jpg" ,rate:5,description:"Romantic"}]);
  
  const addHandler=(newFilm)=>{
   input&&  setMovieList(
      [...movieList,newFilm]
    );
  };
  return (
    <div className="App">

     <h2>Movio</h2>
     <Filter rate={rate} setRate={setRate} setSearch={setSearch} addHandler={addHandler} input={input} setInput={setInput} inputSrc={inputSrc} setInputSrc={setInputSrc} inputRate={inputRate} setInputRate={setInputRate}  
       InputDescription={inputDescription}
       setInputDescription={setInputDescription} />
     <MovieList movieList={movieList} search={search} rate={rate}/>
      
 
    </div>
  );
}

export default App;
